  int32_T nHalf;
  int32_T nQtr;
  int32_T fwdInvFactor;
  int32_T offsetCh;
  int32_T iCh;
  int32_T ix;
  int32_T i2;
  real_T tmp_re;
  real_T tmp_im;
  int32_T idelta;
  int32_T k;
  int32_T kratio;
  int32_T i1;
  int32_T istart;
  int32_T j;
  real_T twidRe;
  real_T twidIm;

  /* DSP System Toolbox Decimation in Time FFT  */
  /* Computation performed using table lookup  */
  /* Output type: complex real_T */
  if (fftLen >= 0) {
    b_fftLen = (int32_T)((uint32_T)fftLen >> 1);
  } else {
    b_fftLen = (int32_T)~(~(uint32_T)fftLen >> 1);
  }

