    SystemCore_release(&st, &ha);
    st.site = &f_emlrtRSI;
    b_SystemCore_release(&st, &he);
    st.site = &g_emlrtRSI;
    c_SystemCore_release(&st, &hf);
    st.site = &h_emlrtRSI;
    d_SystemCore_release(&st, &hrr);

